	 (1054256,'TimberWest Johnstone Strait FSP','APP',NULL,NULL,NULL,'N',3,'Y',NULL,NULL,NULL,20,NULL,NULL,NULL,NULL,TIMESTAMP'2017-09-11 00:00:00',NULL,'Risk of Pw blister rust; unless rust resistant Pw planted stock is used, can not contribute to MSS and limited to 10% of TSS.  Resistant stock can contribute to MSS and up to 25% of MSP and 100% of MSP for Phellinus root rot areas.',NULL,'BCEID\RMMONCHAK',TIMESTAMP'2017-08-09 09:22:11','IDIR\DANTURNE',TIMESTAMP'2019-06-24 09:29:32',4),
	 (1054257,'TimberWest Johnstone Strait FSP','APP',NULL,NULL,NULL,'N',3,'Y',NULL,NULL,NULL,20,NULL,NULL,NULL,NULL,TIMESTAMP'2017-09-11 00:00:00',NULL,'Hw is suitable on thick forest floors an dis preferred on northerly aspects or in situations where advanced natural regeneration of Hw precludes planting with other species and is acceptable in all other situations.\nRisk of white pine blister rust.  Unless resistant stock is planted, Pw cannot contribute to MSS and limited to 10% of TSS.  Resistant stock can contribute to MSS and up to 25% of MSP and 100% of MSP on Phellinus root rot sites.',NULL,'BCEID\RMMONCHAK',TIMESTAMP'2017-08-09 09:25:43','IDIR\DANTURNE',TIMESTAMP'2019-06-24 09:29:32',9);
